export default productsData;
export { productsData as productData };

// 
export function findProductBySku(sku) {
  return productsData.find(p => p.sku === sku);
}

export function getTotalQuantity(product) {
  return product.stockLocations.reduce((sum, loc) => sum + (loc.quantity || 0), 0);
}

export function setPrimaryLocation(product, locationCode) {
  product.stockLocations.forEach(loc => loc.isPrimary = (loc.location === locationCode));
}

export function transferStock(product, fromLocation, toLocation, quantity) {
  const source = product.stockLocations.find(loc => loc.location === fromLocation);
  const target = product.stockLocations.find(loc => loc.location === toLocation);
  if (!source || source.quantity < quantity) return false;
  if (!target) {
    product.stockLocations.push({ location: toLocation, quantity: quantity, isPrimary: false });
  } else {
    target.quantity += quantity;
  }
  source.quantity -= quantity;
  return true;
}

export function adjustStockWithTransaction(product, locationCode, quantity, reason, note) {
  const loc = product.stockLocations.find(l => l.location === locationCode);
  if (!loc) return false;
  loc.quantity += quantity;
  product.transactions.push({
    date: new Date().toISOString().split('T')[0],
    quantity,
    reason,
    note
  });
  return true;
}
